import React from 'react'
import Catalog from '../catalog/catalog'
import Products from '../products/products'
import Header from '../header/header'
import {Route} from 'react-router-dom'
import Basket from '../basket/basket'



const App = () => {

  const classBackgroundData = ['background']

  function setBackgroundColor() {
    classBackgroundData.push('active')
    console.log(classBackgroundData.join(' '))
  }

  function unSetBackgroundColor() {
    classBackgroundData.splice(1)
    console.log(classBackgroundData.join(' '))
  }

  const CatalogComponent = () =>
    <Catalog
      setBackgroundColor={setBackgroundColor}
      unSetBackgroundColor={unSetBackgroundColor} />

    return (
        <div className={classBackgroundData}>
            <Header />
            <Route path="/basket" component={Basket} />
            <Route path="/" exact component={CatalogComponent} />
            <Route path="/" exact component={Products} />
        </div>
    )
}

export default App;
